#include <vector>
#include <algorithm>
#include <unordered_map>

using namespace std;

class Solution {
public:
    int minOperations(vector<int>& nums, int target) {
        unordered_map<int, int> count;
        long long sum = 0;
        for (int x : nums) {
            count[x]++;
            sum += x;
        }
        if (sum < target) return -1;
        int ans = INT_MAX;
        sort(nums.begin(), nums.end());
        nums.erase(unique(nums.begin(), nums.end()), nums.end());
        for (int x : nums) {
            if (sum - x < target) continue;
            int curTarget = target, ops = 0;
            for (int y : nums) {
                if (y >= curTarget) break;
                while (count[y] > 0 && 2 * y <= curTarget) {
                    ops++;
                    count[y]--;
                    count[2 * y]++;
                    y *= 2;
                }
            }
            if (curTarget <= sum) ans = min(ans, ops);
            for (int y : nums) count[y] = 0;
            for (int x : nums) count[x]++;
            sum -= x;
            count[x]--;
        }
        return ans == INT_MAX ? -1 : ans;
    }
};
